import Link from 'next/link'
import '../styles/main.scss'
class Coins extends React.Component {
    render(){
        const { BTC } = this.props.api.DISPLAY;
        console.log(BTC);
        return(
            <div className="coin">
                <img src="" alt=""/>
                <p>00</p>
                <p>00</p>
                <p></p>
                <img src="" alt=""/>
                <button>Like</button>
            </div>
        )
    }
}
export default Coins;
